CREATE TABLE IF NOT EXISTS `cerrajero` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre` varchar(50) DEFAULT NULL,
  `razon_social` varchar(50) NOT NULL,
  `direccion` varchar(50) DEFAULT NULL,
  `direccion_particular` varchar(50) DEFAULT NULL,
  `piso` varchar(50) DEFAULT NULL,
  `nro_local` varchar(50) DEFAULT NULL,
  `cp` varchar(50) DEFAULT NULL,
  `mail` varchar(50) DEFAULT NULL,
  `tel` varchar(50) DEFAULT NULL,
  `tel_24` varchar(50) DEFAULT NULL,
  `cel` varchar(50) DEFAULT NULL,
  `abierta_24` tinyint(1) DEFAULT NULL,
  `web_url` varchar(100) DEFAULT NULL,
  `calco` tinyint(1) DEFAULT NULL,
  `pegue_gane` tinyint(1) DEFAULT NULL,
  `conformidad` varchar(45) DEFAULT NULL,
  `cliente` varchar(45) DEFAULT NULL,
  `updated_at` datetime NOT NULL,
  `created_at` datetime NOT NULL,
  `idGeoloc` int(11) DEFAULT NULL,
  `idProvincia` int(11) DEFAULT NULL,
  `idLocalidad` int(11) DEFAULT NULL,
  `idPais` int(11) DEFAULT NULL,
  `aprobado` int(11) DEFAULT NULL,
  `observacion` varchar(1000) DEFAULT NULL,
  `idNextTel` varchar(50) DEFAULT NULL,
  `entre_calle` varchar(300) DEFAULT NULL,
  `movil` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_geoloc_idx` (`idGeoloc`),
  KEY `fk_provincia_idx` (`idProvincia`),
  KEY `fk_localidad_idx` (`idLocalidad`),
  KEY `fk_pais_idx` (`idPais`),
  CONSTRAINT `fk_geoloc` FOREIGN KEY (`idGeoloc`) REFERENCES `geoloc` (`id`) ON DELETE CASCADE ON UPDATE CASCADE,
  CONSTRAINT `fk_localidad` FOREIGN KEY (`idLocalidad`) REFERENCES `localidad` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_pais` FOREIGN KEY (`idPais`) REFERENCES `pais` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION,
  CONSTRAINT `fk_provincia` FOREIGN KEY (`idProvincia`) REFERENCES `provincia` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=106122 DEFAULT CHARSET=latin1;

CREATE TABLE IF NOT EXISTS `geoloc` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `formattedAddress` varchar(200) DEFAULT NULL,
  `latitude` float DEFAULT NULL,
  `longitude` float DEFAULT NULL,
  `updated_at` datetime NOT NULL,
  `created_at` datetime NOT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=144172 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `localidad` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre_localidad` varchar(45) DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `idProvincia` int(11) DEFAULT NULL,
  `hidden` tinyint(1) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `id_localidad_provincia_idx` (`idProvincia`),
  CONSTRAINT `id_localidad_provincia` FOREIGN KEY (`idProvincia`) REFERENCES `provincia` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=19642 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `migrations` (
  `migration` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `batch` int(11) NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

CREATE TABLE IF NOT EXISTS `pais` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre_pais` varchar(45) DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=313 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `password_resets` (
  `email` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `token` varchar(255) COLLATE utf8_unicode_ci NOT NULL,
  `created_at` timestamp NOT NULL DEFAULT '0000-00-00 00:00:00',
  KEY `password_resets_email_index` (`email`),
  KEY `password_resets_token_index` (`token`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

CREATE TABLE IF NOT EXISTS `provincia` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `nombre_provincia` varchar(45) DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `peso` int(11) DEFAULT '0',
  `idPais` int(11) DEFAULT NULL,
  PRIMARY KEY (`id`),
  KEY `fk_provincia_pais_idx` (`idPais`),
  CONSTRAINT `fk_provincia_pais` FOREIGN KEY (`idPais`) REFERENCES `pais` (`id`) ON DELETE NO ACTION ON UPDATE NO ACTION
) ENGINE=InnoDB AUTO_INCREMENT=2583 DEFAULT CHARSET=utf8;

CREATE TABLE IF NOT EXISTS `users` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(60) DEFAULT NULL,
  `email` varchar(60) DEFAULT NULL,
  `password` varchar(60) DEFAULT NULL,
  `updated_at` datetime DEFAULT NULL,
  `created_at` datetime DEFAULT NULL,
  `remember_token` varchar(100) DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=72 DEFAULT CHARSET=utf8;









